  { id: 'q1', author: 'Corey', text: 'Learning is fun!' },
  { id: 'q2', author: 'Max', text: 'Learning react is great!' },
]

const AllQuotes = () => {
  const {
    sendRequest,
    status,
    data: loadedQuotes,
  } = useHttp(getAllQuotes, true)

  return <QuoteList quotes={DUMMY_QUOTES} />
}

export default AllQuotes
